export const People = [
	{
		name: 'John Smith',
		birthmonth: 'January',
		birthday: 5,
        birthyear: 1980,
        image: './'
	},
	{
		name: 'Jennifer Goran',
		birthmonth: 'July',
		birthday: 4,
		birthyear: 1992,
		image: './Jennifer.jpeg',
	},
	{
		name: 'Peter Miller',
		birthmonth: 'April',
		birthday: 16,
		birthyear: 1978,
	},
	{
		name: 'Shannon Jenkins',
		birthmonth: 'August',
		birthday: 28,
		birthyear: 1954,
	},
];

console.log(People);
